    int N, i;
    Point dominoChain[1000];
    Point dominoStart, yourStart;
    double dominoVelocity, yourVelocity;

    // Read the number of dominoes
    scanf("%d", &N);

    // Read the coordinates of the dominoes
    for (i = 0; i < N; i++) {
